Thorax: Tegula with basal 1 / 2 brownish gray, apical 1 / 2 pale brownish gray, or agouti patterned, with brownish gray on basal and apical 1 / 3 s, and pale brownish gray middle 1 / 3 ; mesonotum with basal 1 / 5 brownish gray, apical 4 / 5 pale brownish gray, or agouti patterned. Legs brownish gray intermixed with pale brownish-gray scales near midsegments and along apical margins of all segments and tarsomeres. Forewing (
Fig. 321
): Length 4.5–7.2 mm (n = 294 ), pale brown intermixed with few brown and brownish-yellow scales; submedian fascia complete or incomplete, faint or dark; cell with three spots, one near middle, one near apical end along crossvein; marginal spots faint or dark. Undersurface brown. Venation (
Fig. 6
