Abdomen: Male genitalia (
Figs. 69–70
): Uncus gradually narrowed from base, broadly rounded apically, slightly downcurved, sparsely setose, longer than width of anal opening. Dorsal strut of tegumen absent. Gnathos wide, confluent with tegumen, posteroventral margin slightly protracted mesially, bidentate; midwidth of pigmented part of gnathos greater than midwidth of uncus. Sockets of tergal setae extending beyond midlength of tegumen. Valva divided; ventral part broadened basally, gradually narrowed apically, forming inwardly curved spinelike process; process setose on outer surface, planate on inner surface; ventral margin setose from 1 / 3 , slightly upturned, forming narrow fold, extending to near base of slightly raised setose lobe at base of spinelike process; dorsal part with apical portion of costa extending dorsolaterally, forming setose digitate process; area beneath costa overlaid with densely packed microtrichiate membrane extending above and below phallus to opposite side; basal ridge of digitate process protracted ventrally fusing with dorsolateral ridge of proximal flange; base of proximal flange extending laterally, forming protuberant ridge; ventrolateral margin of membrane above proximal flange bearing few hairlike setae intermixed with densely packed microtrichiae. Juxta bandlike. Vinculum semicircular. Phallus longer than valva; sclerite of phallus about equal to length of valva, slightly curved subapically and basally; anellus apically wider than at base, setose along margin. Female Genitalia: Unknown.
